import React from "react";

function CompleteCount(props) {
  console.log(props);
  return (
    <div className="count" onClick={()=>props.setCount(5)}>
      <p>Clear All</p>
      <img src="delete.png" alt="delet" className="count-del" />
    </div>
  );
}

export default CompleteCount;
